import React from 'react';
import './assetss/css/App.css';
import "bootstrap/dist/css/bootstrap.css";

import Login from './components/Login';

import { BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route path="/" exact>
              <Login></Login>
          </Route>
        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
